- https://wiki.php.net/rfc/constructor_promotion
- Add unit tests for the formatting feature
- Change the indent behavior in the following case
```php
// there is no parameter
class Test {
    public function __contruct(^){}
}

// before: don't add the new line
class Test {
    public function __contruct(
            ^){}
}

// after: add the new line
class Test {
    public function __contruct(
            ^
    ){}
}
```

```php
// this behavior is the same as before
// there is a parameter
class Test {
    public function __contruct(private int $field,^){}
}

// don't add the new line
class Test {
    public function __contruct(private int $field,
            ^){}
}

```","distinct":true,"url":"https://api.github.com/repos/dbalek/netbeans/commits/9d7588aa28bbc8ef92e57956f3f6da457e8816dd"},{"sha":"b8530e62ffbcbba06303abc7f827c0ceb60855b0","author":{"name":"Junichi Yamamoto","email":"b167b8eb530b93e72c6c0e9a10d8503b2e9a4f7e@apache.org"},"message":"[NETBEANS-4443] PHP 8.0 Support: Constructor Property Promotion (Part 6)

